var text = ["","An important and useful property of chemical equilibrium systems is that they obey what is called the Law of Mass Action. In this module, we’ll discuss the Law of Mass Action for the general reaction shown above.","This law states that at chemical equilibrium, the reaction quotient, Q, of the system will be equal to a constant that depends only on the chemical reaction and temperature.","We call this constant the equilibrium constant and give it the symbol upper-case K. It is expressed in concentration for solutions (on the left), and in partial pressures of gases (on the right).","Let's do an example to see how the law of mass action works. Say we start with one atmosphere each of hydrogen and iodine gas, and these react through the following reversible reaction to form two hydrogen iodide gas-phase molecules.","As the reaction occurs, the partial pressures of the gases will change, but eventually we will reach chemical equilibrium. At this point, we find 0.213 atmospheres each of hydrogen and iodine gas and 1.573 atmospheres of hydrogen iodide gas.","We can summarize this experiment using a table, in which we write the reaction on top, put the initial values in the first row and put the steady state equilibrium values in the second row.","The law of mass action says that Q will equal K at equilibrium. If we plug in the partial pressures in atmospheres we find a value of 54 for the equilibrium constant K.","Let's assume our system is sitting in this steady state equilibrium situation, and we suddenly add an additional 1 atmosphere of iodine gas. LeChatlier's principal tells us that the system will shift in the forward direction to counter the stress.","We'll again summarize what happens in a tabular form. After addition of the 1 atmosphere of iodine gas, we've established a new initial condition.","If we wait and then measure again, we’ll see that at equilibrium, the reaction adjusts leading to these partial pressures.","Now, let’s check to see if the Law of Mass Action was obeyed. Plugging in our new values, we see Q again equals our equilibrium constant of 54. Notice that even though the final concentrations are different than when we started, the equilibrium constant is constant.","This is what the law of mass action means. A reaction system will always adjusts itself such that the law of mass action is obeyed, meaning the reaction shifts until Q becomes equal to the equilibrium constant K.","This phenomenon was originally discovered by Henry Louis LeChatlier, and is named after him. LeChatlier's Principle states that 'If a chemical system at equilibrium experiences a change in concentration, temperature, volume, or partial pressure, then the equilibrium shifts to counteract the imposed change and a new equilibrium is established,' in other words the reaction shifts until Q becomes equal to the equilibrium constant K.","In the Hemoglobin scenario we saw that blood, traveling from the heart is initially at equilibrium.","As the blood enters the lungs, it is exposed to the stress of an increase in oxygen concentration.","This causes the system to no longer be at equilibrium.","The reaction then shifts in a direction that decreases the oxygen concentration in the blood...","...to establish a new equilibrium. LeChatlier's principle simply states that the chemical reaction shifts to counter the stress, in this case decreasing the amount of free oxygen to counter the addition of oxygen."];

